const TILE_TYPES = {
  NONE: -1,
  BLOCK: 0,
  SPIKE: 1,
  HALF: 2,
  MOVING_PLATFORM: 3,
  FALLING_SPIKE: 4,
  MOVING_SPIKE: 5,
  TURRET: 6,
  ROCKET_TURRET: 7,
  SAVE: 8,
  TURRET_PROJECTILE: 9,
  ROCKET_PROJECTILE: 10,
  ORB: 11,
  ORB_PLATFORM: 12,
  TIMED_SPIKE: 13,
}

class TileData {

  constructor(type = TILE_TYPES.NONE, isStatic = false, prop = {}, events = {}) {
    this.type = type;
    this.isStatic = isStatic;
    this.prop = prop;
    this.events = events;
  }

}

class MapTile {

  constructor(data, x, y) {
    this.data = data;
    this.x = x;
    this.y = y;
  }

}

class ActiveMapTile {

  constructor(mt) {
    this.mt = mt;
    this.offX = 0;
    this.offY = 0;
    this.local = {};
  }

}


function withinTile(mapTile, x, y) {
  switch(mapTile.data.type) {
    case TILE_TYPES.ORB:
    case TILE_TYPES.SAVE:
    case TILE_TYPES.BLOCK:
      return (x > mapTile.x && x < mapTile.x + 1 && y > mapTile.y && y < mapTile.y + 1);
    case TILE_TYPES.MOVING_SPIKE:
    case TILE_TYPES.FALLING_SPIKE:
    case TILE_TYPES.SPIKE:
      switch (mapTile.data.prop.dir) {
        default:
        case 0:
          return (x > mapTile.x + lerp(0.5, 0, y - mapTile.y) && x < mapTile.x + 1 - lerp(0.5, 0, y - mapTile.y) && y > mapTile.y && y < mapTile.y + 1);
        case 1:
          return (x > mapTile.x && x < mapTile.x + 1 && y > mapTile.y + lerp(0, 0.5, x - mapTile.x) && y < mapTile.y + 1 - lerp(0, 0.5, x - mapTile.x));
        case 2:
          return (x > mapTile.x + lerp(0, 0.5, y - mapTile.y) && x < mapTile.x + 1 - lerp(0, 0.5, y - mapTile.y) && y > mapTile.y && y < mapTile.y + 1);
        case 3:
          return (x > mapTile.x && x < mapTile.x + 1 && y > mapTile.y + lerp(0.5, 0, x - mapTile.x) && y < mapTile.y + 1 - lerp(0.5, 0, x - mapTile.x));
      }
    case TILE_TYPES.TURRET_PROJECTILE:
    case TILE_TYPES.ROCKET_PROJECTILE:
      return dist(x, y, mapTile.x, mapTile.y) < 0.25;
  }
}

class Button {

  constructor(text, x, y, w, h, click) {
    this.text = text;
    this.x = x;
    this.y = y;
    this.w = w;
    this.h = h;
    this.animation = 0;
    this.click = click;
    this.visible = true;
  }

  testClick() {
    if (isWithin(mouseX, mouseY, this.x, this.y, this.w, this.h)) {
      this.animation = 1;
      this.click();
    }
  }

  update() {
    this.animation = lerp(this.animation, 0, 0.1);
  }

  draw() {
    if (!this.visible) return;
    strokeWeight(1);

    noStroke();
    fill(isWithin(mouseX, mouseY, this.x, this.y, this.w, this.h) ? 230 : 240);
    rect(this.x, this.y, this.w, this.h);

    noStroke();
    fill(220);
    rect(this.x, this.y, this.w * this.animation, this.h);

    stroke(0);
    noFill();
    rect(this.x, this.y, this.w, this.h);

    noStroke();
    fill(0);
    textStyle(NORMAL);
    textAlign(CENTER, CENTER);
    textSize(this.h / 1.5);
    text(this.text, this.x + this.w / 2, this.y + this.h / 2);
  }

  hide() {
    this.visible = false;
  }

  show() {
    this.visible = true;
  }
}

