function reset() {
  mapX = 3;
  mapY = 3;

  save.savePoint = 0;
  save.deaths = 0;

  save.saveMapX = 3;
  save.saveMapY = 3;

  save.orbs = [];

  restart();
}

function switchLevel(x, y, cache = true, px, py) {
  if (cache) {
    cachedMaps[py * 7 + px] = [...map];
  }

  player.time = 0;

  mapX = x;
  mapY = y;

  if (px != undefined && py != undefined && inEditor) {
    fullMap[py * 7 + px] = [JSON.stringify(mapData)];
  }

  mapData = [];

  if (x < 2) {
    currentSong = 3;
  } else {
    currentSong = 2;
  }

  if (x == 3 && y == 0) {
    currentSong = 4;
  }
  

  if (cachedMaps[y * 7 + x] != undefined) {
    loadMap(x, y);
    map = cachedMaps[y * 7 + x];
    
    
  } else {
    loadMap(x, y);
    loadLevel();
  }

  drawLevelStatic();
}

function restart() {
  player = {
    posX: 0, posY: 0, velX: 0, velY: 0,
    inpVelLeft: 0, inpVelRight: 0,
    jumps: 2,
    dead: false,
    time: 0,
  }


  cachedMaps = [];
  teleportToSave();
  save.deaths += 1;

  switchLevel(mapX, mapY, false);
  
  for (let tile of map) {
    tile.local = {};
    tile.offX = 0;
    tile.offY = 0;
  }
  
  restartBoss();
}

function restartBoss() {
  // FLARB

  function spawnSpike(newMap, x, y, dir, spd) {
    let newTile = new ActiveMapTile(new MapTile(new TileData(TILE_TYPES.FALLING_SPIKE, false, {tX: 0, tY: 0, tW: 0, tH: 0, speed: spd, dir: dir, fallDir: dir}, {}), x, y));
    newTile.local.triggered = true;
    newMap.push(newTile);
  }

  bossfight = {
    kick: {
      lastBeat: -2,
      start: 0,
      end: 72,
      interval: 2,
      spawn: (newMap, beat) => {
        let up = (floor(beat * 2.5) + 1) % 6;
        let side = floor(beat / 2) % 2;

        for (let i = 0; i < 4; i++) {
          spawnSpike(newMap, side == 0 ? 0 : (MAP_WIDTH - 1), MAP_HEIGHT - 2 - up * 4 - i, side == 0 ? 1 : 3, 8);
        }
      }
    },
    snare: {
      lastBeat: 7,
      start: 8,
      end: 72,
      interval: 2,
      spawn: (newMap, beat) => {
        let up = (floor((beat + 5) * 2.5) + 1) % 6;
        let side = floor((beat + 2) / 2 ) % 2;

        for (let i = 0; i < 4; i++) {
          spawnSpike(newMap, side == 0 ? 0 : (MAP_WIDTH - 1), MAP_HEIGHT - 2 - up * 4 - i, side == 0 ? 1 : 3, 8);
        }
      }
    },
    hat: {
      lastBeat: 7.5,
      start: 8,
      end: 72,
      interval: 1,
      spawn: (newMap, beat) => {
        let up = (beat * 8 + 1) % 23;
        let side = floor(beat) % 2;

        spawnSpike(newMap, side == 0 ? 0 : (MAP_WIDTH - 1), MAP_HEIGHT - 2 - up, side == 0 ? 1 : 3, 16);
      }
    },
    synth: {
      lastBeat: 38,
      start: 40,
      end: 72,
      interval: 2,
      spawn: (newMap, beat) => {
        
        let side = floor(beat / 2) % 2;
        let edge = floor(beat / 4) % 2;

        for (let i = 0; i < 5 + edge; i++) {
          spawnSpike(newMap, 1 + side * 17 + i + edge * 5, 0 + side * (MAP_HEIGHT - 1), 2 - side * 2, 8);
        }

      }
    },
    synthslam: {
      lastBeat: 38,
      start: 46,
      end: 112,
      interval: 8,
      spawn: (newMap, beat) => {

        for (let i = 0; i < 3; i++) {
          spawnSpike(newMap, 12 + i, 5, 2, 12);
          spawnSpike(newMap, 15 + i, MAP_HEIGHT, 0, 12);
        }

      }
    },
    final1: {
      lastBeat: 79,
      start: 80,
      end: 112,
      interval: 2,
      spawn: (newMap, beat) => {

        let up = floor(beat / 2) % 4;

        for (let i = 0; i < 6; i++) {
          spawnSpike(newMap, 0, MAP_HEIGHT - 2 - up * 6 - i, 1, 16);
        }

      }
    },
    final2: {
      lastBeat: 79.5,
      start: 80,
      end: 112,
      interval: 0.5,
      spawn: (newMap, beat) => {

        let up = floor(beat * 4) % 23;

        spawnSpike(newMap, MAP_WIDTH - 1, MAP_HEIGHT - 2 - up, 3, 16);

      }
    },
    final3: {
      lastBeat: 95.5,
      start: 96,
      end: 112,
      interval: 0.5,
      spawn: (newMap, beat) => {

        let right = floor(beat * 4) % 27;

        spawnSpike(newMap, 1 + right, 0, 2, 20);

      }
    },
    yuck: {
      lastBeat: 111.99,
      start: 112,
      end: 120,
      interval: 0.01,
      spawn: (newMap, beat) => {

        let right = floor(beat * 200) % 27;

        spawnSpike(newMap, 1 + right, 0, 2, 20);

      }
    },
    yuck2: {
      lastBeat: 111.99,
      start: 112,
      end: 120,
      interval: 0.01,
      spawn: (newMap, beat) => {

        let up = floor(beat * 200 + 1) % 23;

        spawnSpike(newMap, 0, MAP_HEIGHT - 2 - up, 1, 16);

      }
    }
  }
}

